A SORE FOR SIGHTED EYES

Imagine living in a world where hundreds of colorful balloons create a backdrop for a bizarre but stirring speech by a mincing health guru.

Imagine a place where charlatans speak to the dead but sound like they are acting in a WWF skit. A world where a preacher turns into a jetfighter from Top Gun. A place where fire hydrants swear at children.

Well stop imagining because that WHOLE world is in the palm of your hand. Introducing the 5th installment in a series of delicious TV CARNAGE MEALS.

So sit back, shoot up and get ready to laugh until you get your barf on!
